import './App.css';
import { useState } from 'react';

function App() {

  const [zip, setZip ] = useState('');

  return (
    <div className="App">
      <form>
        <input 
          type="text"
          placeholder="enter zip"
          value={zip}
          onChange={ e => setZip(e.target.value) }
        />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
}

export default App;
